(65, 29, 'Nas', 'nas-dev@gmail.cim', 'Des secrets éprouvés pour la redaction des e-mails qui convertissent', 'Vous recevez le cours de profit en ligne Top Tips de parce que vous l\'avez demandé. Si vous avez changé d\'avis et que vous ne souhaitez plus augmenter vos bénéfices en ligne, cliquez sur le lien de desinscription en bas de cet e-mail.', 6, 'heures', '3', 0, NULL, NULL),
